tables.table_schema:
CREATE TABLE influencer_profiles (
    influencer_id UUID PRIMARY KEY,
    influencer_name VARCHAR(255),
    followers_count INT,
    engagement_rate FLOAT
);

CREATE TABLE influencer_profiles (
    influencer_id SERIAL PRIMARY KEY,
    influencer_name VARCHAR(50) NOT NULL,
    followers_count INT NOT NULL,
    engagement_rate FLOAT NOT NULL
);

CREATE TABLE social_media_platforms (
   platform_id INT PRIMARY KEY,
   platform_name VARCHAR(50),
   followers INT
);

CREATE TABLE influencer_platforms (
   influencer_id INT,
   platform_id INT,
   FOREIGN KEY (influencer_id) REFERENCES influencer_profiles (influencer_id),
   FOREIGN KEY (platform_id) REFERENCES social_media_platforms (platform_id)
);

CREATE TABLE influencer_payments (
    payment_id INT PRIMARY KEY,
    influencer_id INT,
    payment_amount FLOAT,
    payment_date DATE
);

CREATE TABLE campaign_feedback (
    feedback_id INT PRIMARY KEY,
    campaign_id INT,
    feedback_text TEXT,
    rating INT
);
